		var processNewTiles = function(res, target, aboveHolder, tlArr) {
			// remove empty spaces and temporarily reverse it
			for(var colIndex=0; colIndex<tlArr.length; colIndex++)
				tlArr[colIndex] = tlArr[colIndex].filter( m=>!!m );
			// find the last column with null arrays
			var largIndex = tlArr.reduce((acc, cur, ind) => {
				var numTiles = NUM_ROWS - cur.length;
				return numTiles > 0 && numTiles >= acc[1] ? [ind, numTiles] : acc;
			}, [-1, 0]);
			var colInd = largIndex[0];
			var rowInd = largIndex[1];
			var setRes = false;
			var overshoot = 8;
			var firstDuration = 15;
			var secondDuration = 8;
			var thirdDuration = 15;
			var firstEase = createjs.Ease.cubicIn;
			var secondEase = createjs.Ease.cubicOut;
			var thirdEase = createjs.Ease.cubicInOut;
			var scaleUp = 1.4;
			function fallTile(myTile, deltaY, colInd, rowInd) {
				return createjs.Tween.get(myTile, {useTicks: true}).wait(colInd*6 + (NUM_ROWS-1-rowInd)).to({y: deltaY + overshoot}, firstDuration, firstEase).to({scaleY: scaleUp}, secondDuration, secondEase).to({scaleY: 1, y: deltaY}, thirdDuration, thirdEase).wait(1);
			}
			if(colInd > -1) {
				for(var colIndex=0; colIndex<tlArr.length; colIndex++) {
					var numTilesToAdd = NUM_ROWS - tlArr[colIndex].length;
					if(numTilesToAdd > 0) {
						// create tween for remaining tiles
						tlArr[colIndex].forEach( (tl, ind) => {
							var rwInd = ind + numTilesToAdd;
							if(rwInd !== tl.rowIndex) {
								var yPl = rwInd*90 + (rwInd>0 ? rwInd-1 : 0);
								tl.rowIndex = rwInd;
		//						var firstTw = createjs.Tween.get(tl, {useTicks: true}).wait(colIndex*6 + (NUM_ROWS-1-rwInd)).to({y: yPl + overshoot}, firstDuration, firstEase).to({scaleY: 1.4}, secondDuration).to({scaleY: 1, y: yPl}, thirdDuration, thirdEase).wait(1);
								var firstTw = fallTile(tl, yPl, colIndex, rwInd);
								if(!setRes && colIndex == colInd) {
									firstTw.wait(1).call( () => res() );
									setRes = true;
								}
							}
						});
						// add new tiles 
						var tilesToAdd = [];
						for(var i=0; i<numTilesToAdd; i++) {
							var item = ADD_ARR_TRANS[colIndex].shift();
							tilesToAdd.push(item || getRandomTileType());
						}
						tilesToAdd.forEach( (tileData, index) => {
							var rowIndex = numTilesToAdd-1 - index;
							var tile = getTile(tileData, colIndex, rowIndex, aboveHolder, null, tlArr);
							// set initial transform
							var xPlacement = colIndex*90 + (colIndex>0 ? colIndex-1 : 0);
							var yPlacement = rowIndex*90 + (rowIndex>0 ? rowIndex-1 : 0);
							tile.x = xPlacement;
							tile.y = yPlacement-545;
							target.addChild(tile);
		//					var tw = createjs.Tween.get(tile, {useTicks: true}).wait(colIndex*6 + (NUM_ROWS-1-rowIndex)).to({y: yPlacement + overshoot}, firstDuration, firstEase).to({scaleY: 1.4}, secondDuration).to({scaleY: 1, y: yPlacement}, thirdDuration, thirdEase).wait(1);
							var tw = fallTile(tile, yPlacement, colIndex, rowIndex);
							if(!setRes && colIndex == colInd) {
								tw.wait(1).call( () => res() );
								setRes = true;
							}
							tlArr[colIndex].unshift(tile);
						});
					}
				}	
			}
			else
				res();
		}

		var getPotentialMatches = function(inTileArr, colClamp = 5, rowClamp = 6) {
			var result = [];
			inTileArr.some(k => k.some(tl => {
					var tiles = [];
					// get tiles you can swap to
					for(var i = -1; i < 2; i+=2) {
						var newColIndex = tl.colIndex+i;
						if(newColIndex >= 0 && newColIndex < colClamp)
							tiles.push(inTileArr[newColIndex][tl.rowIndex]);
					}
					for(var i = -1; i < 2; i+=2) {
						var newRowIndex = tl.rowIndex+i;
						if(newRowIndex >= 0 && newRowIndex < rowClamp)
							tiles.push(inTileArr[tl.colIndex][newRowIndex]);
					}
					// change this to filter and iterate over the result
					var oppTl = tiles.find( tile => checkMatches(tl, tile, inTileArr, true).length > 0 );
					if(!!oppTl) {
						if(result.length == 0 || tl.tileType == 'tokenMC' ) {
							result = [tl, oppTl];
							if(tl.tileType == 'tokenMC')
								return true;
						}
					}
					return false;
				})
			);
			return result;
		}
		var moveHand = function(hand, fromTile, toTile) {
			var fromPos = fromTile.parent.localToLocal(fromTile.x + THREE_QUARTER_TILE_SIZE, fromTile.y + THREE_QUARTER_TILE_SIZE, hand.parent);
			var toPosObj = {};
			var toPos = toTile.parent.localToLocal(toTile.x + THREE_QUARTER_TILE_SIZE, toTile.y + THREE_QUARTER_TILE_SIZE, hand.parent, toPosObj);
			Object.assign(hand, ( ({x,y}) => ({x,y}) )(fromPos));
			var distPt = DISTANCE_MEASURE_MC.parent.localToLocal(DISTANCE_MEASURE_MC.x, 0, hand.parent);
			hand.handRight.visible = hand.x < distPt.x;
			hand.handLeft.visible = !hand.handRight.visible; 
			return createjs.Tween.get(hand, {useTicks: true, loop: -1}).to({alpha:1},9).wait(7).to({startPosition:0},0).to(toPosObj,15,createjs.Ease.quadInOut).to({alpha:0},12).to({_off:true},1).wait(10);

		// func: function that returns a value or a promise that resolves a value which is passed to loopConditionFn
		// loopConditionFn: a function that accepts the value from the above func and returns true or false to continue the loop or exit it
		function loopPromise(func, loopConditionFn) {
			function loop() {
		    return Promise.resolve().then( () => func() )
		    .then( val => {
		      if(loopConditionFn(val)) 
		        return loop();
		      return val;
		    });
		  }
		  return loop();
		}
		var startGame = function(res, secondRes, thirdResObj, tiles, above, blingHolder, band, tokensCounter, moveCounter, tlArr) {
			// this will return a promise that resolves to the number of matches
			function clearBoard() {
				var boardProm = new Promise(resolve => clearAllMatches(resolve, tlArr, above, blingHolder, band, tokensCounter));
				return boardProm.then( val => {
					return (new Promise(resolve => processNewTiles(resolve, tiles, above, tlArr))).then(() => val);
				})
			}
			var shouldReject = false;
			function conditionTest(val) {
				if(val > 0) {
					incrementTokenCounter(tokensCounter.counter);
					if(gTokenCount >= TOKEN_TARGET || gMoveCount <= 0) { // this shouldnt happen
						res();
						shouldReject = true;
						return false;
					}
					return true;
				}
				return false;
			}
			function gameLoop() {
				var prom = new Promise(resolve => {
					clearBlingAndBands(blingHolder, band);
					processNewTiles(resolve, tiles, above, tlArr);
				});
				return prom.then(() => {
					return loopPromise(clearBoard, conditionTest).then( val => {if(shouldReject) return Promise.reject();} );
				})
				.then(() => {
					return new Promise(resolve => makeBoardDraggable(resolveToStage(resolve, tlArr, above, blingHolder, band, tokensCounter), above, tlArr, secondRes, thirdResObj));
				})
				.then(() => {
					gMoveCount--;
					decrementMoveCounter(moveCounter.counter);
					res();
				})
				.catch( () => {
					// handled
					return;
				});
			}
			clearBlingAndBands(blingHolder, band);
			gMoveCount--;
			decrementMoveCounter(moveCounter.counter);
			gameLoop();
		}
		var continueGame = function(res, tiles, above, blingHolder, band, tokensCounter, moveCounter, tlArr, hand) {
			// this will return a promise that resolves to the number of matches
			function clearBoard() {
				var boardProm = new Promise(resolve => clearAllMatches(resolve, tlArr, above, blingHolder, band, tokensCounter));
				return boardProm.then( val => {
					return (new Promise(resolve => processNewTiles(resolve, tiles, above, tlArr))).then(() => val);
				})
			}
			var shouldReject = false;
			function conditionTest(val) {
				if(val > 0) {
					incrementTokenCounter(tokensCounter.counter);
					if(gTokenCount >= TOKEN_TARGET || gMoveCount <= 0) { // this shouldnt happen
						res();
						shouldReject = true;
						return false;
					}
					return true;
				}
				return false;
			}
			function gameLoop() {
				var thirdResObj = {};
				var secondRes = () => animateHandToMatches(null, tlArr, hand, thirdResObj);
				var prom = new Promise(resolve => {
					clearBlingAndBands(blingHolder, band);
					processNewTiles(resolve, tiles, above, tlArr)
				});
				return prom.then(() => {
					return loopPromise(clearBoard, conditionTest).then( val => {if(shouldReject) return Promise.reject();} );
				})
				.then(() => {
					return 	new Promise(resolve => makeBoardDraggable(resolveToStage(resolve, tlArr, above, blingHolder, band, tokensCounter), above, tlArr, secondRes, thirdResObj));
				})
				.then(() => {
					gMoveCount--;
					decrementMoveCounter(moveCounter.counter);
					if(gTokenCount >= TOKEN_TARGET || gMoveCount <= 0) {
						res();
						shouldReject = true;
					}
					else
						return gameLoop();
				})
				.catch( () => {
					// handled
					return;
				});
			}
		//	clearBlingAndBands(blingHolder, band);
			gameLoop();
		}

}

	var lib=comp.getLibrary();
